import React, { Component}from "react";
import "./App.css";
import { Switch, Route, Redirect } from "react-router-dom";
import Login from "./components/auth/Login";
import Signup from "./components/auth/Signup";

function App() {
  return (
    <React.Fragment>
      <div className="App">
        <Login></Login>
        <Signup></Signup>
      </div>

    </React.Fragment>
  );
}

export default App;
